    void print_hex(size_t round, uint64_t* state) {
        std::cout << "Round " << round << ":\n";
        for(int i = 0; i < 25; i++) {
            std::cout << std::hex << state[i] << ",";
        }
        std::cout << "\n";
    }

    void HadesMIMCPermutation_63_25_12_34::permute(uint64_t *state) {
        size_t round = 0;
        for(size_t r = 0; r < num_full_rounds/2; r++, round++) {
            ARK(state, round);
            SBOX(state);
            LIN(state);
        }
        for(size_t r = 0; r < num_part_rounds; r++, round++) {
            ARK(state, round);
            SBOX_PART(state);
            LIN(state);
        }
        for(size_t r = 0; r < num_full_rounds/2 - 1; r++, round++) {
            ARK(state, round);
            SBOX(state);
            LIN(state);
        }
        ARK(state, round);
        round++;
        SBOX(state);
        //ARK(state, round);
    }

    void HadesMIMCPermutation_63_25_12_34::SBOX(uint64_t *state) {
        for(size_t i = 0; i < num_sboxes; i++) {
            uint64_t tmp = F_2_63::mulReduce(state[i], state[i]);
            state[i] = F_2_63::mulReduce(tmp, state[i]);
        }
    }

    void HadesMIMCPermutation_63_25_12_34::SBOX_PART(uint64_t *state) {
        uint64_t tmp = F_2_63::mulReduce(state[0], state[0]);
        state[0] = F_2_63::mulReduce(tmp, state[0]);
    }

    void HadesMIMCPermutation_63_25_12_34::LIN(uint64_t *state) {
        uint64_t tmp[num_sboxes] = {0, };

        for (size_t i = 0; i < num_sboxes; i++) {
            uint64_t state_part = state[i];
            for (size_t j = 0; j < num_sboxes; j++) {
                uint64_t matrix_part = M25[i][j];
                tmp[j] = tmp[j] ^ F_2_63::mulReduce(state_part, matrix_part);
            }
        }
        for (size_t i = 0; i < num_sboxes; i++) {
            // reduction mod X^63 + X + 1
            state[i] = tmp[i];
        }

    }

    void HadesMIMCPermutation_63_25_12_34::ARK(uint64_t *state, size_t round) {
        for(size_t i = 0; i < num_sboxes; i++) {
            state[i] ^= RC25[round*num_sboxes + i];
        }

    }
